import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import './index.css';

class initialProfile extends Component {
	constructor(props) {
		super(props);
		this.state = {
			gender: '',
			secualPreference: '',
			biography: '',
		}
	}

	render() {
		return (
			<div>
				<div className="header">
					<div id="title">MATCH<span className="red">A</span></div>
					<div><Link to="/" className="loginheader">Logout</Link></div>
				</div>
				<div className="rest">
					<div>Tell Us More about Yourself</div>
					<form>
						<input
							type="radio"
							value="Female"
						/>
						<input
							type="radio"
							value="Male"
						/>
					</form>
				</div>
			</div>
		)
	}
}

export default initialProfile;
